import React, { useState, useEffect } from 'react';
import { getUsuarios, getUsuario } from '../../api/apiClient';

export default function UsuarioList() {
  const [items, setItems] = useState([]);
  const [id, setId] = useState('');
  const [one, setOne] = useState(null);

  useEffect(() => { load(); }, []);
  function load() { getUsuarios().then(setItems).catch(e => alert('Error: ' + e)); }
  function fetchOne() { if (!id) return alert('Pon un id'); getUsuario(id).then(setOne).catch(e => alert('Error: ' + e)); }

  return (
    <div>
      <h3>Usuarios</h3>
      <div className="card">
        <button onClick={load}>Refrescar</button>
        <div style={{marginTop:8}}>
          <input placeholder="id" value={id} onChange={e=>setId(e.target.value)} />
          <button onClick={fetchOne}>Cargar por id</button>
        </div>
      </div>

      <div className="card">
        <strong>Lista (JSON)</strong>
        <pre>{JSON.stringify(items, null, 2)}</pre>
      </div>

      {one && <div className="card"><strong>Elemento</strong><pre>{JSON.stringify(one, null, 2)}</pre></div>}
    </div>
  );
}
